import * as React from "react";
import './Stylesheets/LoginPage.css';
import LoginForm from "./LoginForm";

function LoginPage() {
  return (<Paper sx={{width:400}} elevation={3}> className="Canvas"><h1 className="LogoHeader">Epinote</h1><LoginForm></LoginForm></Paper>);
}

export default LoginPage  ;
